import React from 'react';
import logo from '/Users/markgiblin/Desktop/layrbase/public/layrbase.png';

const TopNav = () => {
  return (
    <nav className="bg-brand-purple shadow-sm">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          {/* Logo */}
          <div className="flex items-center">
            <div className="flex-shrink-0">
              <div className="flex items-center">
                <img src={logo} alt="LayrBase" className="h-8 w-auto" />
              </div>
            </div>
          </div>

          {/* Right side icons */}
          <div className="flex items-center space-x-4">
            {/* Notification Bell */}
            <button className="p-2 rounded-full text-white hover:bg-opacity-80 hover:bg-brand-purple focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-brand-purple focus:ring-white">
              <svg className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 17h5l-5 5v-5z" />
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 7h6m0 10v-3m-3 3h.01M9 17h.01M9 14h.01M12 14h.01M15 11h.01M12 11h.01M9 11h.01M7 21h10a2 2 0 002-2V5a2 2 0 00-2-2H7a2 2 0 00-2 2v14a2 2 0 002 2z" />
              </svg>
            </button>

            {/* User Profile */}
            <button className="p-2 rounded-full text-white hover:bg-opacity-80 hover:bg-brand-purple focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-brand-purple focus:ring-white">
              <svg className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M16 7a4 4 0 11-8 0 4 4 0 018 0zM12 14a7 7 0 00-7 7h14a7 7 0 00-7-7z" />
              </svg>
            </button>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default TopNav;
